// ==UserScript==
// @name         PhantomScope [Paid]
// @namespace    http://tampermonkey.net/
// @license      Shawn4444
// @version      6.7
// @description  Roblox Ppl Finder In Games with Auto Join Toggle
// @match        https://www.roblox.com/games*
// @grant        GM_xmlhttpRequest
// @connect      websocketsniper.onrender.com
// @icon         data:image/jpeg;base64,
// @downloadURL https://update.greasyfork.org/scripts/533860/PhantomScope%20%5BPaid%5D.user.js
// @updateURL https://update.greasyfork.org/scripts/533860/PhantomScope%20%5BPaid%5D.meta.js
// ==/UserScript==

(function () {
    'use strict';

    const API_BASE        = 'https://websocketsniper.onrender.com/api/sniper';
    const EXPIRY_ENDPOINT = 'https://websocketsniper.onrender.com/api/subscripctionstatus';
    const placeMatch      = location.pathname.match(/\/games\/(\d+)/);
    const placeId         = placeMatch ? placeMatch[1] : null;
    if (!placeId) return;


    function gmFetchJSON(url, onSuccess, onError) {
        GM_xmlhttpRequest({
            method: 'GET',
            url: url,
            onload(res) {
                try {
                    const data = JSON.parse(res.responseText);
                    onSuccess(data);
                } catch {
                    onError();
                }
            },
            onerror() {
                onError();
            }
        });
    }


    async function getUserId(username) {
        const res = await fetch(`https://www.roblox.com/users/profile?username=${username}`);
        if (!res.ok) throw new Error('User not found');
        return res.url.match(/\d+/)[0];
    }


    async function getThumb(userId) {
        const resp = await fetch(
            `https://thumbnails.roblox.com/v1/users/avatar-headshot?userIds=${userId}&format=Png&size=48x48`
        );
        if (!resp.ok) throw new Error('Thumbnail fetch failed');
        const data = await resp.json();
        return data.data[0].imageUrl;
    }


    const container = document.getElementById('running-game-instances-container');
    if (!container) return;

    const section = document.createElement('div');
    section.classList.add('section');
    section.style.marginBottom = '8px';

    const uiStyle = document.createElement('style');
    uiStyle.textContent = `
        /* PhantomScope - upgraded search ui */
        .phantom-search-card {
            background: linear-gradient(180deg, rgba(255,255,255,0.015), rgba(0,0,0,0.03));
            border-radius: 14px;
            padding: 16px;
            box-shadow: 0 18px 48px rgba(2,6,23,0.75);
            border: 1px solid rgba(255,255,255,0.03);
            display: block;
            overflow: hidden;
            font-family: Inter, Arial, sans-serif;
        }
        .phantom-search-title {
            display:flex;
            align-items:center;
            gap:12px;
            color: #f8fafb;
            margin: 0 0 10px 0;
            font-weight: 800;
            font-size: 16px;
            letter-spacing: 0.2px;
        }
        .phantom-search-row { display:flex; gap:14px; align-items:center; flex-wrap:wrap; }
        .phantom-avatar { width:66px;height:66px;border-radius:12px; border:2px solid rgba(255,255,255,0.04); object-fit:cover; display:block; background:linear-gradient(180deg,#061012,#081015); transition: transform 180ms, box-shadow 180ms; }
        .phantom-avatar.loaded { transform: translateY(-4px); box-shadow: 0 20px 50px rgba(0,0,0,0.6); }
        .phantom-input {
            background: rgba(255,255,255,0.02);
            border: 1px solid rgba(255,255,255,0.03);
            padding: 12px 14px;
            border-radius: 12px;
            color: #ffffff;
            outline: none;
            min-width: 340px;
            transition: box-shadow 160ms ease, transform 120ms ease, border-color 120ms;
            font-size: 15px;
            font-weight: 600;
        }
        .phantom-input::placeholder { color: #88a8aa; font-weight:500; }
        .phantom-input:focus { box-shadow: 0 28px 60px rgba(0,0,0,0.7); transform: translateY(-1px); border-color: rgba(255,255,255,0.06); }
        .phantom-btn {
            padding: 10px 14px;
            border-radius: 12px;
            border: none;
            cursor: pointer;
            font-weight: 800;
            transition: transform 150ms cubic-bezier(.2,.9,.2,1), box-shadow 150ms;
            min-width: 140px;
            display:inline-flex;
            align-items:center;
            justify-content:center;
            gap:10px;
            user-select:none;
            font-size:14px;
        }
        .phantom-btn:active { transform: translateY(1px); }
        .phantom-btn[disabled] { opacity: 0.6; cursor: not-allowed; transform:none; box-shadow:none; }
        .phantom-btn-primary {
            background: linear-gradient(180deg,#2c2f33,#18191b);
            color: #ffffff !important;
            box-shadow: 0 12px 36px rgba(3,8,20,0.7);
            border: 1px solid rgba(255,255,255,0.02);
        }
        .phantom-btn-primary:hover { transform: translateY(-2px); box-shadow: 0 26px 60px rgba(3,8,20,0.75); }
        .phantom-btn-icon {
            width:18px;height:18px;display:inline-block;opacity:0.95;
        }
        .phantom-small-muted { font-size:12px;color:#9fb6b8;margin-left:8px; font-weight:600; }
        .phantom-controls-col { display:flex; flex-direction:column; gap:8px; }
        .phantom-status { font-size:13px;color:#dbeff0;margin-top:12px; white-space:pre-wrap; transition: opacity 180ms; }
        .phantom-compact-btn { padding:8px 10px; border-radius:8px; font-size:13px; background: rgba(255,255,255,0.02); color:#e6eef0; border:1px solid rgba(255,255,255,0.03); }
        .phantom-bottom-row { display:flex; gap:10px; align-items:center; margin-top:10px; flex-wrap:wrap; }
        @media (max-width: 880px) {
          .phantom-search-row { flex-direction: column; align-items:stretch; }
          .phantom-input { min-width: auto; width:100%; }
          .phantom-controls-col { flex-direction:row; gap:8px; }
          .phantom-btn { width:100%; justify-content:center; }
          .phantom-avatar { margin: 0 auto; }
        }
    `;
    section.appendChild(uiStyle);
    section.classList.add('phantom-search-card');

    const title = document.createElement('h2');
    title.className = 'phantom-search-title';

    const titleText = document.createTextNode('PhantomScope');
    title.appendChild(titleText);

    const expiryTitle = document.createElement('span');
    expiryTitle.id = 'expiry-title';
    expiryTitle.style.fontSize = '0.9em';
    expiryTitle.style.color = '#FFD700';
    expiryTitle.style.marginLeft = '8px';
    expiryTitle.textContent = '(Loading Expiry)';
    title.appendChild(expiryTitle);

    section.appendChild(title);

    const row = document.createElement('div');
    row.className = 'phantom-search-row';
    section.appendChild(row);

    const avatarContainer = document.createElement('div');
    avatarContainer.style.display = 'flex';
    avatarContainer.style.flexDirection = 'column';
    avatarContainer.style.alignItems = 'center';
    avatarContainer.style.flexShrink = '0';
    row.appendChild(avatarContainer);

    const avatarImg = document.createElement('img');
    avatarImg.className = 'phantom-avatar';
    avatarImg.style.display = 'none';
    avatarContainer.appendChild(avatarImg);

    const form = document.createElement('form');
    form.style.display = 'flex';
    form.style.alignItems = 'flex-start';
    form.style.gap = '12px';
    form.style.flexWrap = 'wrap';
    row.appendChild(form);

    form.addEventListener('submit', (e) => {
        e.preventDefault();
    });

    const input = document.createElement('input');
    input.classList.add('input-field', 'phantom-input');
    input.placeholder = 'Username';
    input.setAttribute('aria-label', 'Player username');
    form.appendChild(input);

    const btnsWrap = document.createElement('div');
    btnsWrap.style.display = 'flex';
    btnsWrap.style.flexDirection = 'column';
    btnsWrap.style.gap = '8px';
    form.appendChild(btnsWrap);

    const topBtnRow = document.createElement('div');
    topBtnRow.style.display = 'flex';
    topBtnRow.style.gap = '8px';
    btnsWrap.appendChild(topBtnRow);

    const searchBtn = document.createElement('button');
    searchBtn.type = 'button';
    searchBtn.classList.add('phantom-btn', 'phantom-btn-primary');
    searchBtn.style.color = '#ffffff';
    searchBtn.style.fontWeight = '800';
    searchBtn.innerText = 'Search';
    searchBtn.disabled = true;
    topBtnRow.appendChild(searchBtn);

    const searchJoinBtn = document.createElement('button');
    searchJoinBtn.type = 'button';
    searchJoinBtn.classList.add('phantom-btn', 'phantom-btn-primary');
    searchJoinBtn.style.color = '#ffffff';
    searchJoinBtn.style.fontWeight = '800';
    searchJoinBtn.innerText = 'Search & Join';
    searchJoinBtn.disabled = true;
    topBtnRow.appendChild(searchJoinBtn);

    const bottomRow = document.createElement('div');
    bottomRow.className = 'phantom-bottom-row';
    section.appendChild(bottomRow);

    const status = document.createElement('div');
    status.className = 'phantom-status';
    status.textContent = '';
    bottomRow.appendChild(status);

    const joinBtn = document.createElement('button');
    joinBtn.type = 'button';
    joinBtn.classList.add(
        'btn-control-xs',
        'rbx-game-server-join',
        'game-server-join-btn',
        'phantom-compact-btn'
    );
    joinBtn.innerText = 'Join';
    joinBtn.style.display = 'none';
    joinBtn.style.marginTop = '6px';
    section.appendChild(joinBtn);

    const inviteBtn = document.createElement('button');
    inviteBtn.type = 'button';
    inviteBtn.classList.add(
        'btn-control-xs',
        'rbx-game-server-join',
        'game-server-join-btn',
        'phantom-compact-btn'
    );
    inviteBtn.innerText = 'Invite';
    inviteBtn.style.display = 'none';
    inviteBtn.style.marginTop = '6px';
    section.appendChild(inviteBtn);

    const specialBtn = document.createElement('button');
    specialBtn.type = 'button';
    specialBtn.classList.add(
        'btn-control-xs',
        'rbx-game-server-join',
        'game-server-join-btn',
        'phantom-compact-btn'
    );
    specialBtn.innerText = 'Copy Teleport Code';
    specialBtn.style.display = 'none';
    specialBtn.style.marginTop = '6px';
    section.appendChild(specialBtn);

    const livePanelExisting = document.getElementById('phantom-live-pull-panel');
    if (livePanelExisting) {
        container.insertBefore(section, livePanelExisting.nextSibling);
    } else {
        container.insertBefore(section, container.firstChild);
    }

    input.addEventListener('input', () => {
        const empty = input.value.trim() === '';
        searchBtn.disabled = searchJoinBtn.disabled = empty;
        if (empty) {
            avatarImg.style.display = 'none';
            avatarImg.classList.remove('loaded');
        }
    });

    let targetUserId = null;
    let searchInProgress = false;

    input.addEventListener('change', async () => {
        const name = input.value.trim();
        if (!name) return;
        try {
            const uid = await getUserId(name);
            targetUserId = uid;
            const thumbUrl = await getThumb(uid);
            avatarImg.src = thumbUrl;
            avatarImg.style.display = '';
            avatarImg.onload = () => avatarImg.classList.add('loaded');
        } catch {
            targetUserId = null;
            avatarImg.style.display = 'none';
            avatarImg.classList.remove('loaded');
        }
    });

    function disableUI() {
        input.disabled = searchBtn.disabled = searchJoinBtn.disabled = true;
    }
    function enableUI() {
        input.disabled = false;
        const empty = input.value.trim() === '';
        searchBtn.disabled = searchJoinBtn.disabled = empty;
    }

    async function doSearch(autoJoin) {
        if (searchInProgress) return false;
        searchInProgress = true;
        disableUI();
        status.textContent = ' Verifying Whitelist';
        joinBtn.style.display = inviteBtn.style.display = specialBtn.style.display = 'none';

        return new Promise(resolve => {
            GM_xmlhttpRequest({
                method: 'POST',
                url: API_BASE,
                headers: { 'Content-Type': 'application/json' },
                data: JSON.stringify({ username: input.value.trim(), placeId }),
                onload(res) {
                    if (res.status !== 200) {
                        let body;
                        try { body = JSON.parse(res.responseText); } catch {}
                        status.textContent = body?.msg ? body.msg : ` ${res.status}`;
                        searchInProgress = false;
                        enableUI();
                        return resolve(false);
                    }
                    const { jobId } = JSON.parse(res.responseText);
                    status.textContent = ' Starting Search';
                    poll(jobId, autoJoin, resolve);
                },
                onerror() {
                    status.textContent = ' Network error';
                    searchInProgress = false;
                    enableUI();
                    resolve(false);
                }
            });
        });
    }

    function poll(jobId, autoJoin, resolve) {
        const start = Date.now();
        (function tick() {
            GM_xmlhttpRequest({
                method: 'GET',
                url: `${API_BASE}/${jobId}`,
                onload(res) {
                    if (res.status !== 200) {
                        let body;
                        try { body = JSON.parse(res.responseText); } catch {}
                        status.textContent = body?.msg ? body.msg : ` ${res.status}`;
                        searchInProgress = false;
                        enableUI();
                        return resolve(false);
                    }
                    const d = JSON.parse(res.responseText);
                    if (!d.done) {
                        status.textContent = d.msg;
                        return setTimeout(tick, 250);
                    }
                    let info;
                    try {
                        info = JSON.parse(d.msg);
                    } catch {
                        status.textContent = d.msg;
                        searchInProgress = false;
                        enableUI();
                        return resolve(false);
                    }
                    const secs = ((Date.now() - start) / 1000).toFixed(0);
                    status.innerHTML =
                        ` Time: ${secs}s<br>` +
                        ` Place Name: ${info.placename}<br>` +
                        ` Players: ${info.players}<br>` +
                        ` FPS: ${info.fps}<br>` +
                        ` Ping: ${info.ping}`;

                    joinBtn.dataset.server = info.serverId;
                    joinBtn.dataset.placeid = info.placeId;
                    joinBtn.style.display = '';

                    inviteBtn.dataset.server = info.serverId;
                    inviteBtn.dataset.placeid = info.placeId;
                    inviteBtn.style.display = '';

                    specialBtn.dataset.server = info.serverId;
                    specialBtn.dataset.placeid = info.placeId;
                    specialBtn.style.display = '';

                    try {
                        if (autoJoin) {
                            Roblox.GameLauncher.joinGameInstance(info.placeId, info.serverId);
                        }
                    } catch (e) {
                        // ignore errors calling GameLauncher
                        console.warn('Auto join failed', e);
                    }

                    searchInProgress = false;
                    enableUI();
                    resolve(true);
                },
                onerror() {
                    status.textContent = ' Poll error';
                    searchInProgress = false;
                    enableUI();
                    resolve(false);
                }
            });
        })();
    }

    function formatTimeLeft(totalSec) {
        const days = Math.floor(totalSec / 86400);
        let rem = totalSec % 86400;
        const hours = Math.floor(rem / 3600);
        rem %= 3600;
        const minutes = Math.floor(rem / 60);
        const seconds = rem % 60;

        return `${days}D ${hours}H ${minutes}M ${seconds}S`;
    }

    function fetchExpiryAndStartCountdown() {
        gmFetchJSON(
            EXPIRY_ENDPOINT,
            data => {
                if (data.expiry == null) {
                    expiryTitle.textContent = '(No Subscription)';
                    return;
                }

                let remaining = data.expiry - Math.floor(Date.now() / 1000);
                if (remaining <= 0) {
                    expiryTitle.textContent = 'Expired';
                    return;
                }

                expiryTitle.textContent = `Expires: ${formatTimeLeft(remaining)}`;

                const intervalId = setInterval(() => {
                    remaining -= 1;
                    if (remaining <= 0) {
                        expiryTitle.textContent = 'Expired';
                        clearInterval(intervalId);
                    } else {
                        expiryTitle.textContent = `Expires: ${formatTimeLeft(remaining)}`;
                    }
                }, 1000);
            },
            () => {
                expiryTitle.textContent = '(Error Fetching Expiry)';
            }
        );
    }
    fetchExpiryAndStartCountdown();

    searchBtn.addEventListener('click', async () => {
        await doSearch(false);
    });

    searchJoinBtn.addEventListener('click', async () => {
        await doSearch(true);
    });

    joinBtn.addEventListener('click', () => {
        const sid = joinBtn.dataset.server;
        const pid = joinBtn.dataset.placeid;
        if (sid) {
            try {
                Roblox.GameLauncher.joinGameInstance(pid, sid);
            } catch (e) {
                console.warn('Join failed:', e);
            }
        }
    });

    inviteBtn.addEventListener('click', () => {
        const srv = inviteBtn.dataset.server;
        const pid = inviteBtn.dataset.placeid;
        const url = `https://fern.wtf/joiner?placeId=${pid}&gameInstanceId=${srv}`;
        if (navigator.clipboard) {
            navigator.clipboard.writeText(url).then(() => {
                inviteBtn.innerText = 'Copied!';
                setTimeout(() => (inviteBtn.innerText = 'Invite'), 2000);
            });
        } else {
            alert('Invite: ' + url);
        }
    });

    specialBtn.addEventListener('click', () => {
        const srv = specialBtn.dataset.server;
        const pid = specialBtn.dataset.placeid;
        const code = `Roblox.GameLauncher.joinGameInstance(${pid}, ${srv});`;
        if (navigator.clipboard) {
            navigator.clipboard.writeText(code).then(() => {
                specialBtn.innerText = 'Copied!';
                setTimeout(() => (specialBtn.innerText = 'Copy Teleport Code'), 2000);
            });
        } else {
            alert('Teleport Code: ' + code);
        }
    });

})();
